import React, { Component } from "react";
import "./node.css";

class Node extends Component {
  state = {
    nodeTyp: "",
  };

  render() {
    if (this.props.nodeType === "start") {
      return <div className="start-node"></div>;
    } else if (this.props.nodeType === "end") {
      return <div className="end_node"></div>;
    } else {
      return <div className="node" onClick></div>;
    }
  }

  componentDidMount() {
    const nodeType = this.props.nodeType;
    this.setState({ nodeType });
  }

  setStart() {}
}

export default Node;
